    function clearRCLGametypeVocs() {

        for (let i = RCLGametypeVocs.childElementCount; i > 0; i--) {
            RCLGametypeVocs.childNodes[i - 1].remove();
        }
    }

    function filterVocs(value) {

        let newValue = '';
        // экранируем знаки
        for (char of value)
            char.match(/([a-z]|[0-9])/i) == null ? newValue += ('\\' + char) : newValue += char;
        let re = new RegExp(newValue, 'i');
        return vocList.filter((x) => {
            return x.text.match(re);
        });
    }

    function create() {

        // проверяем ручной ввод айди словаря с $
        // иначе смотрим цифровой айди в датасете
        // иначе берем буквенный айди из датасета


        var gametype = null;
        var fv = null;

        function getfv(voc) {
            fv = (() => {
                let a = vocList.filter((x) => {
                    return x.id == voc;
                });
                if (a.length > 0)
                    return a[0].text;
                else
                    return null;
            })();
        }

        if (RCLGametype.value.match(/\B\$/)) {
            gametype = 'voc&voc=' + RCLGametype.value.slice(1);
            getfv(RCLGametype.value.slice(1));
        } else if (RCLGametype.value.match(/^\d+$/)) {
            gametype = 'voc&voc=' + RCLGametype.value;
            getfv(RCLGametype.value);
        } else if (RCLGametype.dataset.id.match(/(\d+)/)) {
            gametype = 'voc&voc=' + RCLGametype.dataset.id;
            getfv(RCLGametype.dataset.id);
        } else {
            gametype = RCLGametype.dataset.id;
            getfv(RCLGametype.dataset.id);
        }

        if (findState && fv == null) {
            alert('Словарь не найден, но я попробую создать заезд...');
        }

        // инициализируем чат и ресивим ссылочку
        var gamechatInput = (value) => { document.querySelectorAll('.chat')[1].querySelector('.text').value = value };
        var gamechatSend = () => { document.querySelectorAll('.chat')[1].querySelector('.send').click() };
        var newRaceUrl = ('https://klavogonki.ru/create/?' +
            'gametype=' + gametype +
            '&type=' + currentMode.value +
            '&level_from=' + RCLMin.value +
            '&level_to=' + RCLMax.value +
            '&timeout=' + RCLTimeout.value +
            '&qual=' + currentQual.value +
            '&submit=1'
        );
        newRaceUrl = httpGet(newRaceUrl);
        if (newRaceUrl.status == 403)
            return alert('Создать заезд не получилось, проверьте выбранный словарь.');

        var qual = 'квалификация, ';
        if (!currentQual.value)
            var qual = '';

        var privacy = 'открытая';
        if (currentMode.value == 'private')
            var privacy = 'дружеский';

        if ((RCLMin.value == '1') && (RCLMax.value == '9')) {
            var chatInvite = fv + ', ' + qual + privacy + ', ' + RCLTimeout.value + ' секунд';
        } else {
            var chatInvite = fv + ', ' + qual + privacy + ', ' +
                RCLMin.options[RCLMin.selectedIndex].text + ' — ' +
                RCLMax.options[RCLMax.selectedIndex].text + ', ' +
                RCLTimeout.value + ' секунд';
        }


        if (inviteCutState == 'cut')
            gamechatInput(newRaceUrl.responseURL + ' ');
        else
            gamechatInput(newRaceUrl.responseURL + ' ' + chatInvite);

        if (inviteEditState != 'edit')
            gamechatSend();
    }

